content:
--- Cho thuê nhà góc 2 mặt tiền hẻm xe hơi 69/33 đường D2(Nguyễn Gia Trí) phường 25, Quận Bình Thạnh ---



- Diện tích : 4,5 x 25 m 
- Kết cấu : 1 Trệt + 3 Lầu - Cầu thang nằm 2/3 nhà ;

- Bao gồm 3 phòng lớn mặt trước có ban công và cửa sổ lớn (40 m2) + 2 phòng nhỏ (15 m2) + sân thượng sau ;
- Mặt bằng trống suốt ;
- Khu vực sầm uất - Cung đường thương hiệu - Lợi thế góc 2 mặt tiền thoáng mát và dễ bắt mắt người đi đường thuận tiện kinh doanh mọi ngành ;

- Cho phép kinh doanh đa ngành nghề ;
- Hợp đồng thuê 3 năm / lần - Cọc 3 thanh toán 1 ;

- Giá thuê : 42.500.000 / tháng (thiện chí nhanh lẹ thương lượng thêm)

- LIÊN HỆ : 0888.104.961 để xem trong và thương lượng trực tiếp
